import { useTranslation } from '@@packages/localization/src';
import Row from '@components/organisms/SettingRoleContainer/TableSettingRole/Row';
import Layout from '@layouts/Layout';
import React, { useCallback, useMemo, useState } from 'react';
import { DataGrid, GridColDef, GridValueGetterParams } from '@mui/x-data-grid';
import { Button, Checkbox } from '@mui/material';
import DeleteIcon from '@mui/icons-material/Delete';
import Icon from '@components/atoms/Icon';
import ModalDrawSignature from '@components/atoms/ModalDrawSignature';
import { useDispatch, useSelector } from 'react-redux';
import { setDefaultSignId } from '@redux/Global/reducer';
import { getDefaultSignId } from '@redux/selector';

export interface SignItem {
  id: number;
  signature: string;
}

interface SignatureContainerProps {
  isOpenAddSignature?: boolean;
  onCloseAddSignature?: () => void;
}

const SignatureContainer: React.FC<SignatureContainerProps> = ({isOpenAddSignature = false, onCloseAddSignature}) => {
  // hook
  const { t } = useTranslation();
  const dispatch = useDispatch();

  // redux
  const defaultSignId = useSelector(getDefaultSignId);

  // states
  const [signDefault, setSignDefault] = useState<number>(defaultSignId);
  const [modalSignByIdNumber, setModalSignByIdNumber] = useState<number>(0);
  const [listSign, setListSign] = useState(rowsSign);

  // functions
  const changeSignDefault = (id: number) => {
    dispatch(setDefaultSignId(id));
    setSignDefault(id);
  };

  const handleDeleteSign = useCallback(
    (id: number) => {
      const l: SignItem[] = [...listSign];
      const lItemIdx = l.findIndex((i) => i.id === id);
      if (lItemIdx > -1) {
        l.splice(lItemIdx, 1);
      }

      setListSign(l);
    },
    [listSign],
  );

  const hanleSubmitSign = useCallback(
    (url: string) => {
      if (modalSignByIdNumber > 0) {
        // edit sign
        const l: SignItem[] = [...listSign];
        const lItem = l.find((i) => i.id === modalSignByIdNumber);
        if (lItem != undefined) {
          lItem.signature = url;
        }

        setListSign(l);
        setModalSignByIdNumber(0);
      } else {
        // add sign
        const l: SignItem[] = [...listSign];
        const lItem: SignItem = {
          id: l[l.length - 1].id + 1,
          signature: url,
        };
        l.push(lItem);

        setListSign(l);
        setModalSignByIdNumber(0);
      }
    },
    [modalSignByIdNumber],
  );

  const columns = useMemo(() => {
    const colDefs: GridColDef[] = [
      {
        field: 'id',
        headerName: 'ID',
        width: 80,
        align: 'center',
        headerAlign: 'center',
      },
      {
        field: 'signature',
        flex: 1,
        headerName: 'Signature',
        align: 'center',
        headerAlign: 'center',
        renderCell: (params) => <img className="img-signature" src={params.value} />,
      },
      {
        field: 'setDefault',
        headerName: 'Set as default',
        align: 'center',
        headerAlign: 'center',
        width: 200,
        renderCell: (params) => (
          <Checkbox
            onClick={() => changeSignDefault(Number(params.id))}
            color="success"
            checked={params.id == signDefault}
          />
        ),
      },
      {
        field: 'edit',
        headerName: 'Edit signature',
        align: 'center',
        headerAlign: 'center',
        width: 200,
        renderCell: (params) => (
          <Button
            onClick={() => setModalSignByIdNumber(Number(params.id))}
            variant="outlined"
            color="info"
            startIcon={<Icon icon="edit" color="#0288d1" />}>
            Edit
          </Button>
        ),
      },
      {
        field: 'delete',
        headerName: 'Delete signature',
        align: 'center',
        headerAlign: 'center',
        width: 200,
        renderCell: (params) => (
          <Button
            onClick={() => handleDeleteSign(Number(params.id))}
            variant="outlined"
            color="error"
            startIcon={<DeleteIcon />}>
            Delete
          </Button>
        ),
      },
    ];

    return colDefs;
  }, [listSign, signDefault]);

  return (
    <div className="w-full h-full px-6">
      <div style={{ height: '80%', width: '100%' }}>
        <DataGrid
          rows={listSign}
          columns={columns}
          pageSize={5}
          rowsPerPageOptions={[5]}
        />
      </div>
      <ModalDrawSignature
        isOpen={modalSignByIdNumber !== 0 || isOpenAddSignature}
        onSubmit={hanleSubmitSign}
        onClose={() => {
          setModalSignByIdNumber(0);
          onCloseAddSignature && onCloseAddSignature();
        }}
      />
    </div>
  );
};

export default SignatureContainer;

const sign1 =
  'data:image/png;base64,';

const sign2 =
  'data:image/png;base64,';

const sign3 =
  'data:image/png;base64,';

export const rowsSign: SignItem[] = [
  {
    id: 1,
    signature: sign1,
  },
  {
    id: 2,
    signature: sign2,
  },
  {
    id: 3,
    signature: sign3,
  },
];
